const TaskForm = () => {
    return (  
        // .taskform_main
        <div className="taskform_main">
            <h3>
                Add a new task
            </h3>
            <form className="taskform_form">
                <label>Title:</label>
                <input type="text" required></input>
                <label>Description:</label>
                <input type="text" required></input>
                <label>Deadline:</label>
                <input type="date" required></input>
            </form>
        </div>
    );
}

export default TaskForm;
